import './App.css';


function App() {

  const Task = (value) => {
    return (
      <li>{value}</li>
    );
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <ul>{Task('money')}</ul>
      </header>
    </div>
  );
}

export default App;
